import React from 'react';
import './Categorias.css'

export function Categorias() {
    return (
        <section className="sectionCategorias">    
                <div className="categorias"><img src="icone-camisa.png" alt=""/></div>
                <div><img src="icone-camisa.png" alt=""/></div>
                <div><img src="icone-camisa.png" alt=""/></div>
                <div><img src="icone-camisa.png" alt=""/></div>
        </section>   
    )
}
